css:
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("electron.atom.io") {
    body {
        color: #839496;
        background-color: #002b36;
    }
    h1, h2, h3, h4, h5 {
        color: #b58900;
    }
    .strong-headers h1,
    .strong-headers h2,
    .strong-headers h3 {
        border-color: #268bd2;
    }
    a,
    .docs-breadcrumbs a {
        color: #268bd2;
    }
    blockquote, .blockquote {
        border-color: #93a1a1;
    }
    strong {
        color: #6c71c4;
    }
    .table-ruled tr {
        border-color: #268bd2;
    }
    .subtron {
        background-color: #002b36;
        border-color: #073642;
    }
    .docs-tag,
    .docs-tags {
        background-color: #073642;
        color: #6c71c4;
    }
    h1 code, h2 code, h3 code, h4 code {
        background-color: #073642;
    }
    code {
        color: #93a1a1;
        background-color: #073642;
    }
    .docs h3 code > em, .docs h3 > em, .docs h4 code > em, .docs h4 > em,
    .docs .platform-label {
        background-color: #6c71c4;
        color: #002b36;
    }
    .highlight {
        background-color: #073642;
        border-color: #268bd2;
    }

    .highlight .k,
    .highlight .kr,
    .highlight .kc,
    .highlight .kd {
        color: #6c71c4;
    }
    .highlight .c1 {
        color: #2aa198;
    }
    .highlight .s1,
    .highlight .s2 {
        color: #859900;
    }
    .highlight .mi {
        color: #dc322f;
    }
    .highlight .na {
        color: #b58900;
    }
    .highlight .nt {
        color: #cb4b16;
    }
}
